// @ts-nocheck
import React, { useState } from 'react';
import styled from 'styled-components';

// Simple 2D Stadium Map Component
const StadiumMap = ({ seats, selectedSeat, onSeatSelect }) => {
  return (
    <MapContainer>
      <StadiumContainer>
        {/* Stadium outline */}
        <StadiumOutline>
          {/* Field/Court */}
          <Field />

          {/* Section A */}
          <Section id="section-a">
            <SectionLabel>Section A</SectionLabel>
            <SectionOutline left />
          </Section>

          {/* Section B */}
          <Section id="section-b">
            <SectionLabel>Section B</SectionLabel>
            <SectionOutline right />
          </Section>

          {/* Render seats as dots */}
          {seats.map((seat) => (
            <SeatDot
              key={seat.id}
              section={seat.section}
              row={seat.row}
              number={seat.number}
              isSelected={selectedSeat?.id === seat.id}
              onClick={() => onSeatSelect(seat)}
            >
              <SeatTooltip>
                {seat.id} - ${seat.price}
              </SeatTooltip>
            </SeatDot>
          ))}
        </StadiumOutline>
      </StadiumContainer>

      <Legend>
        <LegendItem>
          <LegendDot color="#000" />
          <LegendText>Available Seat</LegendText>
        </LegendItem>
        <LegendItem>
          <LegendDot color="#1976d2" />
          <LegendText>Selected Seat</LegendText>
        </LegendItem>
      </Legend>

      <Instructions>
        Click on a seat to select it and view details
      </Instructions>
    </MapContainer>
  );
};

const MapContainer = styled.div`
  position: relative;
  height: 100%;
  background-color: white;
  padding: 20px;
  display: flex;
  flex-direction: column;
`;

const StadiumContainer = styled.div`
  flex: 1;
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 20px;
`;

const StadiumOutline = styled.div`
  position: relative;
  width: 100%;
  height: 100%;
  max-width: 600px;
  max-height: 400px;
  border: 2px solid #000;
  border-radius: 100px;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Field = styled.div`
  width: 60%;
  height: 40%;
  background-color: #f5f5f5;
  border: 2px solid #000;
  border-radius: 50%;
  position: relative;

  &::after {
    content: '';
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    width: 10px;
    height: 10px;
    background-color: #000;
    border-radius: 50%;
  }
`;

const Section = styled.div`
  position: absolute;
  width: 30%;
  height: 70%;
  top: 15%;
  left: ${props => props.id === 'section-a' ? '5%' : '65%'};
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const SectionOutline = styled.div`
  width: 100%;
  height: 100%;
  border: 2px solid #000;
  border-radius: ${props => props.left ? '50px 0 0 50px' : '0 50px 50px 0'};
  border-right: ${props => props.left ? 'none' : '2px solid #000'};
  border-left: ${props => props.right ? 'none' : '2px solid #000'};
`;

const SectionLabel = styled.div`
  font-weight: 600;
  font-size: 14px;
  margin-bottom: 10px;
`;

const SeatDot = styled.div`
  position: absolute;
  width: 12px;
  height: 12px;
  border-radius: 50%;
  background-color: ${props => props.isSelected ? '#1976d2' : '#000'};
  cursor: pointer;
  transition: transform 0.2s, background-color 0.2s;
  left: ${props => props.section === 'A' 
    ? `calc(15% + ${(props.number - 1) * 30}px)` 
    : `calc(75% + ${(props.number - 1) * 30}px)`};
  top: ${props => `calc(25% + ${(props.row - 1) * 40}px)`};

  &:hover {
    transform: scale(1.5);
    z-index: 10;
  }

  &:hover > div {
    display: block;
  }
`;

const SeatTooltip = styled.div`
  display: none;
  position: absolute;
  top: -30px;
  left: 50%;
  transform: translateX(-50%);
  background-color: rgba(0, 0, 0, 0.8);
  color: white;
  padding: 4px 8px;
  border-radius: 4px;
  font-size: 12px;
  white-space: nowrap;
  pointer-events: none;
  z-index: 20;
`;

const Legend = styled.div`
  display: flex;
  justify-content: center;
  gap: 20px;
  margin-top: 20px;
`;

const LegendItem = styled.div`
  display: flex;
  align-items: center;
  gap: 8px;
`;

const LegendDot = styled.div`
  width: 12px;
  height: 12px;
  border-radius: 50%;
  background-color: ${props => props.color};
`;

const LegendText = styled.span`
  font-size: 14px;
  color: #333;
`;

const Instructions = styled.div`
  text-align: center;
  margin-top: 20px;
  font-size: 14px;
  color: #666;
`;

export default StadiumMap;
